void printReduction(int lhs,int* p)
{
	printf("%s -> ",nontermString[lhs]);
	while(*p)
	{
		if(*p==TERMEMPTY)
			printf(" ");
		else if(*p<TERMEOF)
			printf("%c ",*p);
		else if(*p<NONTERM_BASE)
			printf("%s ",termString[*p-TERM_BASE]);
		else
			printf("%s ",nontermString[*p-NONTERM_BASE]);
		p++;
	}
	printf("\n");
}
