void Parser::parseerror(char* str)
{
	printf("lr parse error: line %d, %s\n",lex.linecnt,str);
}


Stack::Stack()
{
	init();
}

Stack::~Stack()
{
}

bool Stack::isEmpty()
{
	return _top==-1;
}

bool Stack::isFull()
{
	return _top>=PARSESTACK_SIZE-1;
}

const StackEntry& Stack::peek()
{
	if(!isEmpty())
		return element[_top];
}

void Stack::pop()
{
	if(!isEmpty())
		--_top;
}

StackEntry& Stack::getAt(int n)
{
	if(n>=0&&n<=_top)
		return element[n];
}

int Stack::top()
{
	return _top;
}

void Stack::init()
{
	element[0]=StackEntry(0);
	_top=0;
}

bool Stack::push(const StackEntry& x)
{
	if(isFull()) return false;

	_top++;	
	element[_top]=x;
	return true;
}
